import './App.css';
import {
    BrowserRouter,
    Routes,
    Route,
} from "react-router-dom";

import Home from "./pages/Home";
import NotFound from "./pages/NotFound";

localStorage.getItem()

function App() {

    if (!localStorage.getItem("food_co_access_token")) {
        return (
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={<NotFound/>}/>
                </Routes>
            </BrowserRouter>);
    } else {
        return (
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={<Home/>} />
                    <Route path="*" element={<NotFound/>}/>
                </Routes>
            </BrowserRouter>);
    }


}

export default App;
